import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="container">
        <div className="header">
          <h1>✈️ Flight Seat Recommender</h1>
          <p>Find the best window seat for sunrise and sunset views</p>
        </div>

        <div className="content">
          <div className="form-section">
            <h2>Flight Seat Recommender</h2>
            <p>This is a test to verify the App component loads correctly.</p>
            <p>If you can see this, the React app is working!</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
